objetoCompra:
Serviço de manutenção da Caneca da Bomba Submersa 2000 110v
Obs: - parafuso e porca danificados e caneca queimada;
- Toda a mão de obra da manutenção e eventual troca de peças está incluída no valor.

Contratação de Serviços para:
•	Manutenção preventiva e corretiva dos 21 (vinte e um) aparelhos de ares-condicionados e 01 cortina de ar, existentes no IPRES;
•	Instalação de novos equipamentos de ares-condicionados, quando necessário;
•	Limpeza e higienização dos sistemas de climatização dos ares-condicionados e da cortina de ar, pelo menos 01 (uma) vez ao mês;
•	Verificação e substituição de peças, quando necessário.

informacaoComplementar:
Prisma Acrílico de mesa para identificação:
Especificações - no mínimo altura de 10 cm X 21 cm de largura e profundidade de 9 cm;
Tamanho da folha utilizável 10x21 cm;
Insere papel em ambos os lados;
Espessura mínima de 2 mm;
Corte a laser com ótimo acabamento;
Peça totalmente dobrada;
Transparente e alto brilho.

